INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("ヤマト", -416.5, "2030/01/01 14:59:59", 100, 1, 3001100, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 0.0, "2024/10/31 12:00:00", 2.1, 130011, 3001, 2);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("ヤマト", -416.5, "2030/01/01 14:59:59", 101, 4, 3001101, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 0.0, "2024/10/31 12:00:00", 5.68, 130011, 3001, 2);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("ヤマト", -416.5, "2030/01/01 14:59:59", 102, 1, 3001102, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 0.0, "2024/10/31 12:00:00", 0.0, 130011, 3001, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", -416.5, "2030/01/01 14:59:59", 100, 1, 3002100, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 0.0, "2024/10/31 12:00:00", 0.0, 130211, 3002, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", -416.5, "2030/01/01 14:59:59", 101, 1, 3002101, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 0.0, "2024/10/31 12:00:00", 0.0, 130211, 3002, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", -416.5, "2030/01/01 14:59:59", 102, 5, 3002102, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 0.0, "2024/10/31 12:00:00", 8.53, 130211, 3002, 2);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", -416.5, "2030/01/01 14:59:59", 103, 7, 3002103, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 0.0, "2024/10/31 12:00:00", 5.67, 130211, 3002, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", -416.5, "2030/01/01 14:59:59", 104, 1, 3002104, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 0.0, "2024/10/31 12:00:00", 0.0, 130211, 3002, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", -416.5, "2030/01/01 14:59:59", 300, 3, 3002300, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 0.0, "2024/10/31 12:00:00", 0.0, 130211, 3004, 3);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", -416.5, "2030/01/01 14:59:59", 301, 7, 3002400, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 0.0, "2024/10/31 12:00:00", 0.0, 130211, 3005, 7);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", -416.5, "2030/01/01 14:59:59", 200, 2, 3003200, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 0.0, "2024/10/31 12:00:00", 4.4, 130211, 3003, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", -416.5, "2030/01/01 14:59:59", 201, 7, 3003201, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 0.0, "2024/10/31 12:00:00", 0.0, 130211, 3003, 7);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES ("フブキ", -416.5, "2030/01/01 14:59:59", 202, 1, 3003202, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 0.0, "2024/10/31 12:00:00", 5.6, 130211, 3003, 2);
